    return (
      <div
        style={{
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          height: '90vh'
        }}>
        <div className="container">
            <h1>Create Customer</h1>    
            <PostCreate />
            <hr/>
            <h1>List</h1>
            <PostList />
        </div>
      </div>
    );
  };
  
  export default Customers;
